import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
// import App from './App';
import reportWebVitals from './reportWebVitals';

import {createBrowserRouter, RouterProvider} from 'react-router-dom'

import Home from './pages/Home.js'
import FormCurso from './pages/FormCurso.js'
import FormProfessor from './pages/FormProfessor.js'
import FormPeriodo from './pages/FormPeriodo.js'
import FormSala from './pages/FormSala.js'
import FormMateria from './pages/FormMateria.js'
import FormHorario from './pages/FormHorario.js'


const router = createBrowserRouter([
  {path:"/", element:<Home />},
  {path:"/FormCurso", element:<FormCurso/>},
  {path:"/FormProfessor", element:<FormProfessor/>},
  {path:"/FormPeriodo", element:<FormPeriodo/>},
  {path:"/FormSala", element:<FormSala/>},
  {path:"/FormMateria", element:<FormMateria/>},
  {path:"/FormHorario", element:<FormHorario/>},
])

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {/* <App /> */}
    <RouterProvider router={router}/>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
